                <div className="card-body">
                  <h4 className="card-title">New - 1</h4>
                  <p className="card-text">Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget,...</p>
                </div>
              </div>
            </div>
            <hr />
          </div>
        );
    }
}

